import React from "react";
import Footer from "./Footer";
import "./NftList.css";
import Navbar from "./Navbar";
function NftList() {
  return (
    <header>
      <text>Explore Collections</text>
      <div>
        <ul className="nftList">
          {/*map으로 구현 */}
          <li>All NFTs</li>
          <li>Art</li>
          <li>Music</li>
          <li>Domain Names</li>
          <li>Virtual Worlds</li>
          <li>Trading Cards</li>
          <li>Collectibles</li>
          <li>Sports</li>
          <li>Utility</li>
        </ul>
      </div>
    </header>
  )
}

export default NftList;
